import React, { Component } from "react";
import { MDBDataTable } from "mdbreact";

class users extends Component {
  state = {
    columns: [
      {
        label: "Name",
        field: "name",
        sort: "asc",
        width: 150
      },
      {
        label: "Position",
        field: "position",
        sort: "asc",
        width: 270
      },
      {
        label: "Office",
        field: "office",
        sort: "asc",
        width: 200
      },
      {
        label: "Age",
        field: "age",
        sort: "asc",
        width: 100
      },
      {
        label: "Start date",
        field: "date",
        sort: "asc",
        width: 150
      },
      {
        label: "Salary",
        field: "salary",
        sort: "asc",
        width: 100
      }
    ],
    rows: [this.state]
  };
  render() {
    return <MDBDataTable striped bordered hover data={this.state} />;
  }
}

export default users;
